import React, { useEffect } from "react";

// Define the System interface to represent a system object with optional fields for various types
interface System {
  _id: string;
  type: string; // The type of system: 'workflow', 'vendorSolution', 'vehicle'
  workflowItems?: string[]; // Array of workflow items (if the system is a workflow)
  vendorType?: string; // Vendor type (if the system is a vendor solution)
  vendorName?: string; // Vendor name (if the system is a vendor solution)
  year?: number; // Year of the vehicle (if the system is a vehicle)
  make?: string; // Make of the vehicle (if the system is a vehicle)
  model?: string; // Model of the vehicle (if the system is a vehicle)
}

// Props for the SystemTable component
interface SystemTableProps {
  systems: System[]; // Array of systems to display in each table
  onDeleteSystem: (systemId: string) => void; // Function for deleting a system
  onEditSystem: (systemId: string) => void; // Function for editing a system
}

// Log the systems to help with debugging
useEffect(() => {
  console.log("Systems received:", systems);
}, [systems]);

// Table for Workflow systems
const WorkflowTable: React.FC<SystemTableProps> = ({
  systems,
  onDeleteSystem,
  onEditSystem,
}) => {
  const workflowSystems = systems.filter(
    (system) => system.type === "workflow"
  );

  // Check if the table should render
  if (workflowSystems.length === 0) {
    return null; // Don't display table if there are no workflow systems
  }

  return (
    <>
      <h3 className="text-xl font-semibold mb-4">Workflows</h3>
      <table className="min-w-full table-auto bg-white shadow-lg">
        <thead>
          <tr>
            <th className="px-4 py-2">Workflow Items</th>
            <th className="px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {workflowSystems.map((system) => (
            <tr key={system._id}>
              <td className="border px-4 py-2">
                <ul>
                  {system.workflowItems?.map((item, index) => (
                    <li key={index}>{item}</li>
                  ))}
                </ul>
              </td>
              <td className="border px-4 py-2">
                <button
                  onClick={() => onEditSystem(system._id)}
                  className="bg-yellow-500 text-white px-4 py-1 rounded mr-2 hover:bg-yellow-600"
                >
                  Edit
                </button>
                <button
                  onClick={() => onDeleteSystem(system._id)}
                  className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

// Table for Vendor Solution systems
const VendorSolutionTable: React.FC<SystemTableProps> = ({
  systems,
  onDeleteSystem,
  onEditSystem,
}) => {
  const vendorSolutions = systems.filter(
    (system) => system.type === "vendorSolution"
  );

  if (vendorSolutions.length === 0) {
    return null;
  }

  return (
    <>
      <h3 className="text-xl font-semibold mb-4">Vendor Solutions</h3>
      <table className="min-w-full table-auto bg-white shadow-lg">
        <thead>
          <tr>
            <th className="px-4 py-2">Vendor Name</th>
            <th className="px-4 py-2">Vendor Type</th>
            <th className="px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {vendorSolutions.map((system) => (
            <tr key={system._id}>
              <td className="border px-4 py-2">{system.vendorName}</td>
              <td className="border px-4 py-2">{system.vendorType}</td>
              <td className="border px-4 py-2">
                <button
                  onClick={() => onEditSystem(system._id)}
                  className="bg-yellow-500 text-white px-4 py-1 rounded mr-2 hover:bg-yellow-600"
                >
                  Edit
                </button>
                <button
                  onClick={() => onDeleteSystem(system._id)}
                  className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

// Table for Vehicle systems
const VehicleTable: React.FC<SystemTableProps> = ({
  systems,
  onDeleteSystem,
  onEditSystem,
}) => {
  const vehicleSystems = systems.filter((system) => system.type === "vehicle");

  if (vehicleSystems.length === 0) {
    return null;
  }

  return (
    <>
      <h3 className="text-xl font-semibold mb-4">Vehicles</h3>
      <table className="min-w-full table-auto bg-white shadow-lg">
        <thead>
          <tr>
            <th className="px-4 py-2">Year</th>
            <th className="px-4 py-2">Make</th>
            <th className="px-4 py-2">Model</th>
            <th className="px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {vehicleSystems.map((system) => (
            <tr key={system._id}>
              <td className="border px-4 py-2">{system.year}</td>
              <td className="border px-4 py-2">{system.make}</td>
              <td className="border px-4 py-2">{system.model}</td>
              <td className="border px-4 py-2">
                <button
                  onClick={() => onEditSystem(system._id)}
                  className="bg-yellow-500 text-white px-4 py-1 rounded mr-2 hover:bg-yellow-600"
                >
                  Edit
                </button>
                <button
                  onClick={() => onDeleteSystem(system._id)}
                  className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

// Main component for displaying the tables for all systems
const SystemTable: React.FC<SystemTableProps> = (props) => {
  return (
    <div className="space-y-8">
      <WorkflowTable {...props} />
      <VendorSolutionTable {...props} />
      <VehicleTable {...props} />
    </div>
  );
};

export default SystemTable;
